import React from 'react';
import TimeSeriesChart from '../simulate/TimeSeriesChart';
import CO2DonutChart from '../simulate/CO2DonutChart';

function CompareGraphs({ simulations, onBack }) {
  if (!simulations || simulations.length === 0) {
    return (
      <div className="compare-graphs-empty">
        <p>No simulations selected for comparison.</p>
        {onBack && (
          <button 
            className="back-to-compare-btn"
            onClick={onBack}
          >
            Back to Table
          </button>
        )}
      </div>
    );
  }

  // Group charts by type for side-by-side comparison
  const timeSeriesData = simulations.map((simulationResult, index) => {
    const { predictions, inputs } = simulationResult;
    const country = inputs?.country || 'Unknown';
    const policyType = inputs?.policyType === 'CARBON_TAX' ? 'Carbon Tax' : 'ETS';
    const carbonPrice = inputs?.carbonPriceUSD || 0;
    const duration = inputs?.durationYears || 0;
    return {
      id: simulationResult.id || index,
      country,
      policyType,
      carbonPrice,
      duration,
      predictions,
      simulationResult
    };
  });

  const co2ChartData = simulations.map((simulationResult, index) => {
    const { predictions, countryContext, inputs } = simulationResult;
    const country = inputs?.country || 'Unknown';
    const policyType = inputs?.policyType === 'CARBON_TAX' ? 'Carbon Tax' : 'ETS';
    const carbonPrice = inputs?.carbonPriceUSD || 0;
    const duration = inputs?.durationYears || 0;
    return {
      id: simulationResult.id || index,
      country,
      policyType,
      carbonPrice,
      duration,
      predictions,
      countryContext,
      simulationResult
    };
  });

  return (
    <div className="compare-graphs-container">
      <div className="compare-graphs-header">
        <h2 className="compare-graphs-title">Comparative Analysis ({simulations.length} policies)</h2>
        {onBack && (
          <button 
            className="back-to-compare-btn"
            onClick={onBack}
          >
            Back to Table
          </button>
        )}
      </div>

      {/* Time Series Charts - Grouped together */}
      <div className="compare-chart-group">
        <h3 className="compare-chart-group-title">Time Series Projection</h3>
        <div className="compare-charts-grid">
          {timeSeriesData.map((data) => (
            <div key={data.id} className="compare-chart-wrapper">
              <div className="compare-chart-header">
                <h4 className="compare-policy-title-small">
                  {data.country} - {data.policyType}
                </h4>
                <div className="compare-policy-details-small">
                  <span>${data.carbonPrice.toFixed(2)}/ton</span>
                  <span>{data.duration} years</span>
                </div>
              </div>
              <TimeSeriesChart
                durationYears={data.duration}
                predictions={data.predictions}
                yearStart={2024}
              />
            </div>
          ))}
        </div>
      </div>

      {/* CO2 Coverage Charts - Grouped together */}
      <div className="compare-chart-group">
        <h3 className="compare-chart-group-title">COâ‚‚ Coverage Comparison</h3>
        <div className="compare-charts-grid">
          {co2ChartData.map((data) => (
            <div key={data.id} className="compare-chart-wrapper">
              <div className="compare-chart-header">
                <h4 className="compare-policy-title-small">
                  {data.country} - {data.policyType}
                </h4>
                <div className="compare-policy-details-small">
                  <span>${data.carbonPrice.toFixed(2)}/ton</span>
                  <span>{data.duration} years</span>
                </div>
              </div>
              <CO2DonutChart
                predictions={data.predictions}
                countryContext={data.countryContext}
                carbonPriceUSD={data.carbonPrice}
              />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default CompareGraphs;
